static char *msGetEnvURL( const char *key, void *thread_context )
{
    if( strcmp(key,"REQUEST_METHOD") == 0 )
        return "GET";

    if( strcmp(key,"QUERY_STRING") == 0 )
        return (char *) thread_context;

    return NULL;
}

